VALUES ('7640126172026', 'Mövenpick Crema Gusto Italiano', 'D Eine erlesene Mischung aus mittel - und südamerikanischen Arabicas und asiatischem Robusta. Die auserlesenen Kaffeebohnen entfalten ein besonders volles Aroma mit feinsten Schokoladenoten. Ein köstlicher GUSTO ITALIANO in der Kapsel, der für Ihre Kreationen auf Milchbasis ideal ist.  F Un mélange sélectionné composé d\'arabica d\'Amérique Méridionale et de robusta d\'Asie. Les grains de cafe spécialement choisis et torrefes développent un arome intense aux délicates notes de chocolat. Un délicieux GUSTO ITALIANO en capsules, ideal pour vos créations à base de lait.  E A blend composed of selected Arabica coffee from Central and South America and Robusta coffee from Asia. The carefully selected beans develop an intense aroma with delicate notes of chocolate. The delicious GUSTO ITALIANO in capsules. Ideal for milk-based drinks.  INHALT: 100% Röstkaffee gemahlen. Bohnenkaffee von Rainforest-Alliance-zertifizierten Farmen. 10 Kapseln geeignet für Ihre NESPRESSO * - Maschine.  CONTENU: 100% café torréfié et moulu. Café de fermes certifiées Rainforest Alliance. 10 capsules compatibles avec votre machine NESPRESSO. CONTENTS: 100% roast and ground coffee. Coffee from Rainforest Alliance CertifiedTM farms. 10 capsules compatible with your NESPRESSO* machine.', 'https://static.openfoodfacts.org/images/products/764/012/617/2026/front_fr.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

