INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7640154061620', 'nespresso capsules', 'Mélange audacieux de Robustas du Brésil et du Guatemala spécialement préparés pour Nespresso et d\'un Arabica d\'Amérique FRdu Sud torréfié séparément, Kazaar est un café d\'une exceptionnelle intensité. Sa puissante amertume et ses notes poivrées sont DE équilibrées par une texture dense et crémeuse. Intensité 12. Les capsules Nespresso originales ont été spédalement conques pour optimiser la qualité d\'extraction des machines Nespresso et garantir la qualité d\'un authentique café Nespresso A daring blend induding Robustas from Brazil and Guatemala, specially prepared for Nespresso, and a separately Eroasted Arabica from South America, Kazaar is a coffee of exceptional intensity. Its powerful bitterness and notes of pepperare balanced bya full and creamytexture. Intensity 12.Genuine Nespresso capsules are specaifically designed to optimize the extraction quality of the Nespresso machines and guarantee the ultimate Nespresso coffee quality Kazaar is een gedurfde melange met zowel Robusta-variëteiten uit Brazilië als Guatemala,speciaal bereid voor Nespresso,en een apart gebrande Arabica uit Zuid-Amerika.Kazaar is een koffie meteen uitzonderlijke intensiteit.Zijn krachtige bitterheid met tonen van peper wordt in evenwicht gehouden door een volle en romige textuur. Intensiteit 12.Originele Nespresso capsules zijn speciaal ontworpen 2 om de extractiekwaliteit van de Nespresso machines te optimaliseren en de ultieme Nespresso koffiekwaliteit te garanderen.', 'https://static.openfoodfacts.org/images/products/764/015/406/1620/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

